css:
atom-pane-container {
  display: -webkit-flex;
  -webkit-flex: 1;
}
atom-pane-container atom-pane-axis.vertical {
  display: -webkit-flex;
  -webkit-flex: 1;
  -webkit-flex-direction: column;
}
atom-pane-container atom-pane-axis.horizontal {
  display: -webkit-flex;
  -webkit-flex: 1;
  -webkit-flex-direction: row;
}
atom-pane-container atom-pane {
  position: relative;
  display: -webkit-flex;
  -webkit-flex: 1;
  -webkit-flex-direction: column;
  overflow: visible;
}
atom-pane-container atom-pane .item-views {
  -webkit-flex: 1;
  display: -webkit-flex;
  min-height: 0;
  min-width: 0;
  position: relative;
}
atom-pane-container atom-pane .item-views .pane-item {
  color: #444444;
  background-color: #f4f4f4;
}
atom-pane-container atom-pane .item-views > *,
atom-pane-container atom-pane .item-views > atom-text-editor.react > * {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
}
